    def __str__(self):

        mmm = []
        rr = self.rows()
        cc = self.cols()



        if self.is_real():

    #        print "is real"

            for r in range(rr):
                mmm.append([])
                for c in range(cc):
                    ij = self.getRe(r,c)
                    (mmm[r]).append( ij )

        else:
            for r in range(rr):
                mmm.append([])
                for c in range(cc):
                    ij = self.get(r,c)
                    (mmm[r]).append( ij.real()+ij.imag()*1j )

        mmm = numpy.array(mmm)
        mmm_str = mmm.__str__()
        del mmm
        return  mmm_str 




