    def toNParray( self ):


        rr = self.rows()
        cc = self.cols()




        if self.is_real():
            mmm = numpy.zeros((rr,cc))

            for r in range(rr):
                for c in range(cc):
                    ij = self.getRe(r,c)
                    mmm[r][c] = ij

        else:
            mmm = numpy.zeros((rr,cc), dtype=numpy.complex128)

            for r in range(rr):

                for c in range(cc):
                    ij = self.get(r,c)
                    mmm[r][c] =  ij.real()+ij.imag()*1j

        return mmm


